import  mongoose  from 'mongoose';

const { String } = mongoose.Schema.Types;

const LogSchema = new mongoose.Schema({
    mediaUrl: {
        type: String,
        required: true
    },
    date: {
        type: Date,
        reqired: true
    },
    type: {
        type: Array,
        required: true
    },
    hours: {
        type: Number,
    },
    amount: {
        type: Number,
    },
    description: {
        type: String,
        required: true
    },
    notes: {
        type: String,
    }
});

export default mongoose.models.Log || mongoose.model("Log", LogSchema)
